import { useParams } from "react-router";
import MovieList from "./MovieList";
import Pagination from "./Pagination";

const GetMovies = () => {

  const {page} = useParams(); 
  return (
    <center>
      <MovieList page={page}/>
      {/* <Pagination/> */}
    </center>
  );
};

export default GetMovies;
